    for _ in range(2 * n - 2):
        pairs.append(stdin.readline().strip())

    # eliminate pairs from the list which are suffixes or prefixes
    suffix_or_prefix_pairs = []
    for pair in pairs:
        if pair[:n-1] == s:
            suffix_or_prefix_pairs.append(pair)
    pairs = suffix_or_prefix_pairs

    # check if there is at least one pair for each length
    for length in range(1, n):
        if len(pairs) < 2 * length:
            return ""

    # generate the result string
    result = []
    for length in range(1, n):
        prefix_pairs = []
        for pair in pairs:
            if pair[:length] == s[:length]:
                prefix_pairs.append(pair)
        pairs = prefix_pairs
        result.append("P" * len(prefix_pairs))
        result.append("S" * len(suffix_or_prefix_pairs))

    return "".join(result)

