def solution(stdin: str) -> str:
    lines = stdin.split('\n')
    N, M = map(int, lines[0].split(' '))
    edges = [(map(int, line.split(' ')), map(int, line.split(' ')))
             for line in lines[1:]]

    edges = list(map(lambda (a, b): (a - 1, b - 1), edges))
    graph = [[] for _ in range(N)]
    for edge in edges:
        graph[edge[0]].append(edge[1])
        graph[edge[1]].append(edge[0])
    visited = [0] * N
    def visit(node):
        visited[node] = 1
        for neighbour in graph[node]:
            if visited[neighbour] == 0:
                visit(neighbour)
    def is_connected(node1, node2):
        visit(node1)
        return visited[node2] == 1
    bridge_count = 0
    for i in range(len(edges)):
        for j in range(i + 1, len(edges)):
            if is_connected(edges[i][0], edges[j][0]):
                bridge_count += 1
    return bridge_count

